// src/components/PlayerProfile.tsx
import React, { useState } from 'react';
import {
  Box,
  FormControl,
  FormLabel,
  Input,
  Button,
  Heading,
  Stack,
  Text,
  Select,
} from '@chakra-ui/react';

const PlayerProfile: React.FC = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [age, setAge] = useState('');
  const [role, setRole] = useState<'Batter' | 'Bowler' | 'All-Rounder'>('Batter');
  const [team, setTeam] = useState('');
  const [phone, setPhone] = useState('');
  const [profilePic, setProfilePic] = useState('');
  const [battingStats, setBattingStats] = useState({ runs: 0, matchesPlayed: 0 });
  const [bowlingStats, setBowlingStats] = useState({ wickets: 0, matchesPlayed: 0 });

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    // Perform update logic (e.g., send data to server)
    alert('Profile updated successfully!');
    console.log({
      name,
      email,
      age,
      role,
      team,
      phone,
      profilePic,
      battingStats,
      bowlingStats,
    });
  };

  return (
    <Box
      bg="white"
      p={6}
      borderRadius="md"
      boxShadow="lg"
      maxWidth="500px"
      mx="auto"
    >
      <Heading as="h2" size="lg" mb={4} textAlign="center" color="#2a2e43">
        Edit Profile
      </Heading>
      <form onSubmit={handleSubmit}>
        <Stack spacing={4}>
          <FormControl isRequired>
            <FormLabel>Name</FormLabel>
            <Input
              type="text"
              value={name}
              onChange={(e) => setName(e.target.value)}
              placeholder="Enter your name"
            />
          </FormControl>
          <FormControl isRequired>
            <FormLabel>Email</FormLabel>
            <Input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="Enter your email"
            />
          </FormControl>
          <FormControl isRequired>
            <FormLabel>Age</FormLabel>
            <Input
              type="number"
              value={age}
              onChange={(e) => setAge(e.target.value)}
              placeholder="Enter your age"
            />
          </FormControl>
          <FormControl isRequired>
            <FormLabel>Role</FormLabel>
            <Select
              value={role}
              onChange={(e) => setRole(e.target.value as 'Batter' | 'Bowler' | 'All-Rounder')}
            >
              <option value="Batter">Batter</option>
              <option value="Bowler">Bowler</option>
              <option value="All-Rounder">All-Rounder</option>
            </Select>
          </FormControl>
          <FormControl>
            <FormLabel>Team</FormLabel>
            <Input
              type="text"
              value={team}
              onChange={(e) => setTeam(e.target.value)}
              placeholder="Enter your team name"
            />
          </FormControl>
          <FormControl>
            <FormLabel>Phone Number</FormLabel>
            <Input
              type="tel"
              value={phone}
              onChange={(e) => setPhone(e.target.value)}
              placeholder="Enter your phone number"
            />
          </FormControl>
          <FormControl>
            <FormLabel>Profile Picture URL</FormLabel>
            <Input
              type="url"
              value={profilePic}
              onChange={(e) => setProfilePic(e.target.value)}
              placeholder="Enter profile picture URL"
            />
          </FormControl>
          <FormControl>
            <FormLabel>Batting Stats</FormLabel>
            <Text>Runs: {battingStats.runs} | Matches Played: {battingStats.matchesPlayed}</Text>
          </FormControl>
          <FormControl>
            <FormLabel>Bowling Stats</FormLabel>
            <Text>Wickets: {bowlingStats.wickets} | Matches Played: {bowlingStats.matchesPlayed}</Text>
          </FormControl>
          <Button
            type="submit"
            colorScheme="yellow"
            variant="solid"
            width="full"
          >
            Save Changes
          </Button>
        </Stack>
      </form>
    </Box>
  );
};

export default PlayerProfile;
